import { Component, OnInit } from '@angular/core';

@Component({
  selector:'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.scss'],
  imports: [FontAwesomeModule], // Import FontAwesomeModule for icons

})

export class HomeComponent implements OnInit {
  generatedNumbers: number[] = [];
  numbersClicked: number[] = [];
  secretNumbersVisible = false;

  faCircleExclamation = faCircleExclamation;
  faCircleCheck = faCircleCheck;
  faEye = faEye;
  faEyeSlash = faEyeSlash;

  constructor() {}

  ngOnInit() {}
}



import { FontAwesomeModule } from '@fortawesome/angular-fontawesome';
import { faCircleExclamation, faCircleCheck, faEye, faEyeSlash } from '@fortawesome/free-solid-svg-icons';
